import styled from 'styled-components';
import './App.css';
import './FrontScreen';
import MyChart from './MyChart';


class RecordFuel extends Component {
  constructor(props) {
    super(props);
    this.myRef = React.createRef();
    this.state = {
    }
  }

  render() {

    <FrontScreen id='FrontScreen' ref={this.myRef} />
    return (        
        <div class="card">
            <div class="card-body">

            <h5>Fuel Expenditure</h5>   
            <div>
                    <Button theme="ResultsButton" FrontScreen={this.FrontScreen} onClick={this.goBack}>
                        Back
                    </Button>
                </div>
            </div>
        </div>
    );
  }
}
export default RecordFuel;
